import React from 'react';
import { Link } from "react-router-dom";

const PokemonList = ({ pokemon }) => {

  // const [pokemonData, setPokemonData] = useState()


 


  return (
    
    <Link>
     <div>
        {pokemon.map(p => (
          <div   key={p}>{p}</div>
        ))}
     </div>
    </Link>
  )

};

export default PokemonList;
